                color: rgb(255, 255, 255);
                text-transform: uppercase;
                transition: all .4s ease-in-out;
                // max-width: 130px;
                text-align: center;
                font-size: 12px;
                min-height: 50px;
                letter-spacing: 1px;
                font-family: 'arimoregular', sans-serif;
                &:hover{
                    background-color: lighten($base-color,2%);
                    color: #fff;
                }
            }
        }
    }
